    public function testResolve(array $argTypes, \TenantCloud\BetterReflection\Relocated\PHPStan\Reflection\ParametersAcceptor $parametersAcceptor, \TenantCloud\BetterReflection\Relocated\PHPStan\Reflection\ParametersAcceptor $expectedResult) : void
