        $this->assertInstanceOf(\get_class($expectedResult->getReturnType()), $result->getReturnType(), 'Unexpected return type');
        $this->assertSame($expectedResult->getReturnType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()), $result->getReturnType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()), 'Unexpected return type');
        $resultParameters = $result->getParameters();
        $expectedParameters = $expectedResult->getParameters();
        $this->assertCount(\count($expectedParameters), $resultParameters);
        foreach ($expectedParameters as $i => $param) {
            $this->assertInstanceOf(\get_class($param->getType()), $resultParameters[$i]->getType(), \sprintf('Unexpected parameter %d', $i + 1));
            $this->assertSame($param->getType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()), $resultParameters[$i]->getType()->describe(\TenantCloud\BetterReflection\Relocated\PHPStan\Type\VerbosityLevel::precise()), \sprintf('Unexpected parameter %d', $i + 1));
